import React from 'react'
import SideBar from './ProfileComp/SideBar'
import Introduction from './ProfileComp/Introduction'
import PharmacoTool from './ProfileComp/PharmacoTool'

class Profile extends React.Component {
    constructor(){
        super();
        this.state ={
            headerShowen : false
        }
        this.handleClick = this.handleClick.bind(this)
    }
    handleClick(){
        this.setState(prevState=> ({
            headerShowen : !prevState.headerShowen
        })
    )}
    render(){
        return (
            <div className="Profile">
                <h4>{this.state.headerShowen}</h4>
                <SideBar status={this.state.headerShowen}/>
                <Introduction handleClick={this.handleClick}/>
                <PharmacoTool />
            </div>
        )
    }
}
export default Profile;
